import React from 'react';
import {Box, Button, Center, Flex, Input, Stack} from "@chakra-ui/react";
import Card from "./card";

const Home = () => {
    return (
        <Flex
            p={8}
            bg={'#F7FAFC'}
            minHeight={'100vh'}
            w={'100%'}
            direction={'column'}
            alignItems={'flex-start'}
        >
            <Box minW={'1000px'}>
                <Stack boxShadow={'md'}
                       borderRadius={'10px'}
                       bg={'white'} p={'100px'}
                       direction={'row'}

                >
                    <Input minH={'50px'} placeholder={'Enter a join code'}/>
                    <Button minH={'50px'}
                            bgGradient="linear(to-l, #7928CA, #FF0080)"
                            color={'white'}>Join</Button>
                </Stack>
            </Box>
            <Card/>

        </Flex>
    );
};

export default Home;
